'use strict';
let GetInstrumentsMessage = require('./GetInstrumentsMessage.js');
let stdlib = require('@gehtsoft/LuaxStdlib-node').stdlib;
class GetInstrumentsMessageBuilder extends GetInstrumentsMessage {
    addInstrument(instrument) {
        this.instrumentsList.add(instrument);
    }
    setRequestId(requestId) {
        this.requestId = requestId;
    }
    addInstruments(instruments) {
        let i;
        if (this.instrumentsList == null) {
            stdlib.print("instrumentsList == nil");
        }
        if (instruments != null) {
            for (i = 0; i <= instruments.length() - 1; i += 1) {
                this.instrumentsList.add(instruments.get(i));
            }
        }
    }
    build() {
        return this;
    }
}
module.exports = GetInstrumentsMessageBuilder
